  false,\n\t\"url\": null,\n\t\"notes\": \"This expedition on the NOAA Ship Nancy
  Foster used the recently-developed National Undersea Research Center for the North
  Atlantic and Great Lakes (NURC-NAGL) ROV Proteus to investigate deep coral areas,
  and other suspected areas of essential fish habitat on the outer continental shelf
  and upper slope of the South Atlantic Bight. Targets for the dives were mapped with
  the Nancy Foster's state-of-the-art multibeam sonar in the summer of 2006.\",\n\t\"license_title\":
